import * as React from 'react';
import './OptionOne.css'
import HomeOutlinedIcon from '@mui/icons-material/HomeOutlined';
import PeopleAltOutlinedIcon from '@mui/icons-material/PeopleAltOutlined';

export interface IProps {
}

export function OptionOne (props: IProps) {
return (
    <div className='container opt1 p-0 m-5'>
        <div className='row'>
            <div className='col-12 p-0 d-flex justify-content-between'>
                <div className='col-1 p-3 d-flex flex-column justify-content-between sideMenu'>
                    <div className='col-12 mb-4 circle d-flex justify-content-center'>
                        <span></span>
                    </div>
                    <div className='col-12 mb-4 icon py-1 rounded d-flex justify-content-center '>
                        <HomeOutlinedIcon sx={{color:'#0B0B0B'}}/>
                    </div>
                    <div className='col-12 mb-4  d-flex justify-content-center '>
                        <PeopleAltOutlinedIcon fontSize='large' sx={{ transition:'0.3s',cursor:'pointer',color:'#0B0B0B','&:hover':{color:'#1D4ED8',backgroundColor:'red'}}}/>
                    </div>
                </div>
            </div>
        </div>
    </div>
);
}
